import React, {useState, useEffect} from 'react';
import './App.css';


function Shop() {

  useEffect(() => {
    fetchItems();
  }, []);

  const fetchItems = async () => {
    const data = await fetch(
      'https://www.alphavantage.co/query?function=TIME_SERIES_INTRADAY&symbol=MSFT&interval=5min&apikey=demo'
    );
    console.log(data);
  };

  return(
    <div>
      <h1>Shop Page</h1>
    </div>
  );
};


export default Shop;
